      if ((action === "add" || action === "remove") && !targetUID) {
        return api.sendMessage("Please specify a UID or reply to a user.", event.threadID);
      }

      if (action === "add") {
        if (role === "admin" && !adminConfig.adminUIDs.includes(targetUID)) {
          adminConfig.adminUIDs.push(targetUID);
          fs.writeFileSync("admin.json", JSON.stringify(adminConfig, null, 2), "utf8");
          return api.sendMessage(`üõ°Ô∏è ùóîùó±ùó∫ùó∂ùóª ùóîùó±ùó±ùó≤ùó±\nSuccessfully added new admin UID ${targetUID}`, event.threadID, () => {
            process.exit(1);
          });
        } else if (role === "mod" && (!adminConfig.moderatorUIDs || !adminConfig.moderatorUIDs.includes(targetUID))) {
          adminConfig.moderatorUIDs = adminConfig.moderatorUIDs || [];
          adminConfig.moderatorUIDs.push(targetUID);
          fs.writeFileSync("admin.json", JSON.stringify(adminConfig, null, 2), "utf8");
          return api.sendMessage(`üëÆ ùó†ùóºùó±ùó≤ùóøùóÆùòÅùóºùóø ùóîùó±ùó±ùó≤ùó±\nSuccessfully added new moderator UID ${targetUID}`, event.threadID, () => {
            process.exit(1);
          });
        } else {
          return api.sendMessage(`UID: ${targetUID} is already an ${role}.`, event.threadID);
        }
      }

      if (action === "remove" && role === "admin") {
        if (adminConfig.adminUIDs.includes(targetUID)) {
          adminConfig.adminUIDs = adminConfig.adminUIDs.filter(uid => uid !== targetUID);
          fs.writeFileSync("admin.json", JSON.stringify(adminConfig, null, 2), "utf8");
          return api.sendMessage(`üõ°Ô∏è ùóîùó±ùó∫ùó∂ùóª ùó•ùó≤ùó∫ùóºùòÉùó≤ùó±\nSuccessfully removed admin UID ${targetUID}`, event.threadID, () => {
            process.exit(1);
          });
        } else {
          return api.sendMessage(`UID: ${targetUID} is not an admin.`, event.threadID);
        }
      }

      let adminList = [];
