      }

      let moderatorList = [];
      if (adminConfig.moderatorUIDs) {
        for (let modUID of adminConfig.moderatorUIDs) {
          let modInfo = await api.getUserInfo(modUID);
          let modName = modInfo[modUID].name;
          moderatorList.push(`[ ${modUID} ] ${modName}`);
        }
      }

      let message = `üë• ùóîùó±ùó∫ùó∂ùóª ùóÆùóªùó± ùó†ùóºùó±ùó≤ùóøùóÆùòÅùóºùóø ùóüùó∂ùòÄùòÅ\nüõ°Ô∏è Admins:\n${adminList.join("\n")}\n\n`;
      if (moderatorList.length > 0) {
        message += `üëÆ Moderators:\n${moderatorList.join("\n")}`;
      } else {
        message += `üëÆ No moderators assigned.`;
      }

      api.sendMessage(message, event.threadID);
