    config: {
        name: "botinfo",
        aliases: ["binfo"],
        version: "1.0",
        author: "AceGerome",
        countDown: 10,
        role: 0,
        description: {
            en: "Get the Bot information such as uptime, ping, and group info."
        },
        category: "info",
        guide: { en: "{pn}" }
    },

    onStart: async function ({ api, event, args, usersData, threadsData, message }) {
        try {
            // Group info
            let threadInfo = await api.getThreadInfo(event.threadID);
            var memLength = threadInfo.participantIDs.length;
            let threadMem = threadInfo.participantIDs.length;

            var genderM = [];
            var genderF = [];
            var nope = [];

            // Collect gender information
            for (let userId in threadInfo.userInfo) {
                var userGender = threadInfo.userInfo[userId].gender;
                if (userGender === "MALE") {
                    genderM.push(userId + userGender);
                } else if (userGender === "FEMALE") {
                    genderF.push(userGender);
                } else {
                    nope.push(threadInfo.userInfo[userId].name);
                }
            }

            // Count gender distribution
            var M = genderM.length;
            var F = genderF.length;

            // Collect information about administrators
            var listad = '';
            for (let i = 0; i < threadInfo.adminIDs.length; i++) {
                const infu = (await api.getUserInfo(threadInfo.adminIDs[i].id));
                const name = infu[threadInfo.adminIDs[i].id].name;
                listad += `‚Ä¢ ${name}\n`;
            }

            const allUsers = await usersData.getAll();
            const allThreads = await threadsData.getAll();

            // Uptime calculation
            const uptime = process.uptime();
            const hours = Math.floor(uptime / 3600);
            const minutes = Math.floor((uptime % 3600) / 60);
            const seconds = Math.floor(uptime % 60);

            // Ping measurement
            const timeStart = Date.now();
            const BoxID = api.getCurrentUserID();
            await api.sendMessage("Checking Bot's info.", BoxID);
            const ping = Date.now() - timeStart;

