                `‚îú‚îÄ„Äå UPTIME „Äç` + 
                `‚îÇ¬ª Bot running in ${uptimeString}.` + 
                `‚îú‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚≠î` + 
                `‚îú‚îÄ„Äå PING „Äç` + 
                `‚îÇ¬ª The current ping is ${ping}ms.` + 
                `‚îú‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚≠î` + 
                `‚îú‚îÄ„Äå BOX INFO „Äç` + 
                `‚îÇ¬ª Thread Name: ${threadInfo.threadName}` + 
                `‚îÇ¬ª Thread ID: ${threadInfo.threadID}` + 
                `‚îÇ¬ª Number of Member: ${threadMem}` + 
                `‚îÇ¬ª Number of Male: ${M}` + 
                `‚îÇ¬ª Number of Female: ${F}` + 
                `‚îÇ¬ª Number of Admin: ${threadInfo.adminIDs.length}` + 
                `‚îÇ¬ª Number of Messages: ${threadInfo.messageCount}` + 
                `‚ï∞‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚≠ì`, event.threadID);
        } catch (error) {
            console.error(error);
            api.sendMessage("An error occurred: ", error, event.threadID);
        }
    }
